jQuery(document).ready(function(e){elementor.hooks.addAction("panel/open_editor/widget/pafe-form-builder-field",function(e,i,d){var l=e.$el.find(".elementor-form-field-shortcode"),n=e.$el.find('[data-setting="field_id"]');if(l.length){var a=n.val().trim();""!=a?l.val('[field id="'+a+'"]'):l.val("")}n.on("change, keyup",function(){var e=n.val().trim();""!=e?l.val('[field id="'+e+'"]'):l.val("")})})});